CREATE TABLE `freshrss_freshrss_feed` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `url` varchar(511) CHARACTER SET latin1 NOT NULL,
  `category` smallint(6) DEFAULT '0',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `website` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `description` text COLLATE utf8_unicode_ci,
  `lastUpdate` int(11) DEFAULT '0',
  `priority` tinyint(2) NOT NULL DEFAULT '10',
  `pathEntries` varchar(511) COLLATE utf8_unicode_ci DEFAULT NULL,
  `httpAuth` varchar(511) COLLATE utf8_unicode_ci DEFAULT NULL,
  `error` tinyint(1) DEFAULT '0',
  `keep_history` mediumint(9) NOT NULL DEFAULT '-2',
  `cache_nbEntries` int(11) DEFAULT '0',
  `cache_nbUnreads` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `url` (`url`),
  KEY `category` (`category`),
  KEY `name` (`name`),
  KEY `priority` (`priority`),
  KEY `keep_history` (`keep_history`),
  CONSTRAINT `freshrss_freshrss_feed_ibfk_1` FOREIGN KEY (`category`) REFERENCES `freshrss_freshrss_category` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
